  --color-accent: #1565d8;
  --color-text: #183b56;
  --color-text-light: #5a7184;

  /* background-image: url('data:image/svg+xml;base64,<svg xmlns="http://www.w3.org/2000/svg" width="1440" height="876" fill="none"> <path fill-rule="evenodd" clip-rule="evenodd" d="M1440 89.807H0V0c240 27.37 480 41.054 720 41.054S1200 27.37 1440 0v89.807z" fill="#F8FBFF"/> <path fill="url(#paint0_linear)" d="M0 89.807h1440V876H0z"/> <defs> <linearGradient id="paint0_linear" x1="0" y1="89.807" x2="0" y2="876" gradientUnits="userSpaceOnUse"> <stop stop-color="#F8FBFF"/> <stop offset="1" stop-color="#FAFBFB" stop-opacity=".01"/> </linearGradient> </defs> </svg>');*/
  background-repeat: no-repeat;
  background-size: contain;
  display: flex;
  flex-direction: column;
  margin: 0 auto;
  padding-top: 3rem;
  padding-bottom: 3rem;
}

.title-wrapper {
  width: 100%;
  margin: 0% auto;
  text-align: center;
}

.dashboard {
  margin: 64px auto;
  border-top: 3px solid var(--color-accent);
  border-radius: 0.25rem;
}

.grid-container {
  display: block;
  grid-template-columns: 1fr 1fr 1fr 1fr;
  box-shadow: 0 0 #0000, 0 0 #0000, 0 20px 25px -5px rgba(0, 0, 0, 0.1),
    0 10px 10px -5px rgba(0, 0, 0, 0.04);

  .grid-item {
    background-color: rgba(255, 255, 255, 0.8);
    padding: 3rem;
    display: flex;
    flex-direction: column;
    align-items: center;
    text-align: center;
    border-bottom: 1px solid #e5eaf4;
  }
}

.rating {
  margin-top: 32px;
  color: var(--color-text);
}

@media (min-width: 1024px) {
  .grid-container {
    display: grid;
    grid-template-columns: auto auto auto auto;
  }
}

